import React from 'react';

function Profile({ user }) {
    return (
        <div className="container" style={{ padding: 40, textAlign: 'center' }}>
            <h2>Profile</h2>
            <p>Name: {user.name}</p>
            <p>Email: {user.email}</p>
        </div>
    );
}

export default Profile;
